import React, { Component } from 'react';
import {Section, Notification, Content} from 'bloomer';
import Quotes from '../components/quotes';
import './styles.css';

export class Home extends Component {
  constructor(props) {
    super(props);
    this.state = { address: '' };
  }

  handleChange = address => {
    this.setState({ address });
  };
  render() {
    return (
      <div>
        <body>
          <Section>
            <Content >
              <p>An application for mental health resources and tracking</p>
            </Content>
            <Notification isColor='primary'>
                <Quotes/>
            </Notification>
          </Section> 
        </body>
      </div>
  );
  }
}

export default Home;
